### 1. Planteamiento de problema

El presente análisis tiene por objetivo describir y dar a conocer la información bimestral por el concepto de suministro de agua a nivel manzana, considerando la facturación por servicio de consumo total y promedio en la Ciudad de México.

&lt;img src="images_arthur/consumo.png" width="2560" /&gt;

---

### 2. Datos

Los datos corresponden al consumo de agua de la Ciudad de México. Dicho conjunto de datos puede ser obtenido a través del siguiente [enlace](https://datos.cdmx.gob.mx/explore/dataset/consumo-agua/export/).

La tabla de datos contiene 71,102 registros y 17 variables. A fin de comprender el conjunto de datos, se muestra a continuación el significado de cada una de las variables involucrada en el análisis de datos.

&lt;img src="images_arthur/agua.png" width="683" /&gt;

---

class: inverse, center, middle

&lt;img src="images_arthur/consumotot_alcaldia.png" width="800px" height="400px" /&gt;

### ¿Cómo se distribuye el consumo total por categoría de índice de desarrollo por bimestre?

Se muestra la distribución del consumo total por bimestre. El comportamiento de la distribución por bimestre de los otros consumos totales y consumos promedios es semejante.

&lt;img src="images_arthur/constot_bim.png" width="800px" height="375px" /&gt;

---

### ¿Cómo se distribuye el consumo total por categoría de indice de desarrollo por colonia?

Se muestra la distribución del consumo total de las 15 colonias con el mayor número de observaciones. Los otros consumos totales y consumos promedios siguen una distribución semejante.

&lt;img src="images_arthur/top15coloniasconsumo_tot.png" width="800px" height="375px" /&gt;

---

### ¿Cuántas manzanas presentan consumo total o promedio cero?

.pull-left[

* Existen 2451 manzanas que presentan consumo total igual a cero

* Hay 29 colonias en total en las que todas las manzanas presentan cosumo total cero

* Debido a que el promedio de consumo se calcula a través del consumo total, son las mismas manzanas y colonias que tienen consumo total cero las que presentan consumo promedio igual a cero

# Conclusiones

* Existe una relación espacial con el índice de desarrollo. En las zonas rurales en donde el índice de desarrollo es bajo, el consumo de agua también lo es. Alcaldías como Miguel Hidalgo y Benito Juárez presentan consumo alto e índice de desarrollo alto también.

* Las manzanas que presentan menor consumo de agua o incluso nulo consumo, son más probables de ser categorizadas con índice de desarrollo popular. En su mayoría, estas manzanas se encuentran en las alcaldías de Milpa Alta, Xochimilco, Tláhuac, sur de Tlalpan y Magdalena Contreras

* Hay ciertas alcaldías que sí muestran una tendencia importante a ser categorizadas en un índice de desarrollo particular. Por ejemplo, Iztapalapa, Iztacalco y Azcapotzalco tenderán a ser clasificados como "bajo".

* Desafortunadamente no es posible incluir la dimensión temporal en el análisis por falta de datos.

---

# Conclusiones

* Evaluando similitudes entre los distintos índices de desarrollo y su consumo, notamos que la categorías "alto" y "popular" muestran un comportamiento similar. De igual manera, las categorías "bajo" y "medio" también muestran un comportamiento parecido.


* Existen alcaldías en las que tenemos un porcentaje mayor de observaciones. El cliente debe de determinar si la información incorpora todas las manzanas existentes de las alcaldía o sólo se reportan alguna.
